import React from "react";
import './dispetch.css';

 function dispetch(){
    return(
        <>
        <h1>This is dispetch Page...!</h1>
        <div className="card-container container">
            <div className="card">
                <div className="card-body">
                    <h1 className="disp"> Your Ouder SuccessFully Dispetch..!</h1>
                </div>
            </div>
        </div>
        </>
    );
 }

 export default dispetch;
